import React from 'react';

import PieChart from 'react-simple-pie-chart';
function InformationChart() {
  return (
    <div className='informationChart'>
      <PieChart
        slices={[
          { color: '#f00', value: 10 },
          { color: '#0f0', value: 20 }
        ]}
      />
    </div>
  );
}

export default InformationChart;
